import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  width: 816px;
  border: 1px solid;
  margin: 0px 102px 30px 78px;
  text-align: left;

  .container {
    display: inline-block;
    border: 1px solid;
    margin-left: 8px;
    
  }
`;

const Comment = (props) => {
  return <>
    <Wrapper>
      <img className="profileIcon" src="assets/images/icons/profile.png" alt="profile" />
      <div className="container">
        작성자
      </div>
    </Wrapper>
  </>;
};

export default Comment;
